-- contract_token_id: 对应JSON的contract_token_id字段
-- token_id: 对应JSON的token_id字段
-- erc_type: 对应JSON的erc_type字段
-- from_address: 对应JSON的send字段
-- to_address: 对应JSON的receive字段
